import React, { Component } from 'react'

class Login extends Component {

    constructor(props) {
        super(props);
        this.state = {
            items: ['ajay', 'ak', 'ak10']

        }
    }
    render() {
        return (
            <div>
                <h1>Welcome to login Form</h1>
                <li>{this.state.items}</li>
            </div>
        )
    }


}

export default Login;
